          return (
            <tr key={machine["id"]}>
              <td>{machine["id"]}</td>
              <td>{machine["pumpname"]}</td>
              <td>{time}</td>
              <td>"status"</td>
              <td id="stopwateringbutton" onClick={(event) => {

